jQuery.noConflict();jQuery(document).ready(function($){	$('.street-style4 img.moves-left').css('margin-left',-100);	$('.street-style6 img.moves-left').css('margin-left',-100);	$('.video-style2 img.moves-left').css('margin-left',-100);			$(window).scroll(function() {		var diff = $(window).scrollTop(),		street_style4_elementOffset_1 = $('.street-style4:eq(0)').offset().top,			street_style4_distance_1 = 0.05*(street_style4_elementOffset_1 - diff),		street_style4_elementOffset_2 = $('.street-style4:eq(1)').offset().top,			street_style4_distance_2 = 0.05*(street_style4_elementOffset_2 - diff),		video_style2_elementOffset_2 = $('.video-style2').offset().top,			video_style2_distance_2 = 0.05*(video_style2_elementOffset_2 - diff),		street_style6_elementOffset_1 = $('.street-style6:eq(0)').offset().top,			street_style6_distance_1 = 0.05*(street_style6_elementOffset_1 - diff),		street_style5_elementOffset_1 = $('.street-style5:eq(0)').offset().top,			street_style5_distance_1 = 0.1*(street_style5_elementOffset_1 - diff);			//console.log($('.collection5'));			//console.log($('.collection6'));				if(street_style5_distance_1 < 50 && street_style5_distance_1 > -100){			//console.log(street_style5_distance_1);			//console.log($('.street-style3 img.move'));			//$('.street-style3 img.moves-left').css('margin-left',-100 - street_style5_distance_1);			$('.street-style5 img.zoom').css('width',1060 + street_style5_distance_1);		}				if(street_style4_distance_1 < 50 && street_style4_distance_1 > -100){			//console.log(trend1_distance);			$('.street-style4:eq(0) img.move').css('margin-left',-50+ street_style4_distance_1 );			//$('.street-style4 img.move').css('margin-left',-50 - 2*street_style4_distance_1);		}		if(street_style4_distance_2 < 50 && street_style4_distance_2 > -100){			//console.log(trend1_distance);			$('.street-style4:eq(1) img.moves-left').css('margin-left',-50+ street_style4_distance_2 );			//$('.street-style4 img.move').css('margin-left',-50 - 2*street_style4_distance_1);		}		if(video_style2_distance_2 < 50 && video_style2_distance_2 > -100){			//console.log(trend1_distance);			$('.video-style2 img.moves-left').css('margin-left',-50+ video_style2_distance_2 );			$('.video-style2 img.zoom').css('width',1330 + video_style2_distance_2);									//$('.street-style4 img.move').css('margin-left',-50 - 2*street_style4_distance_1);		}		if(street_style6_distance_1 < 50 && street_style6_distance_1 > -100){			//console.log(trend1_distance);			$('.street-style6 img.moves-right').css('margin-left',-50+ street_style6_distance_1 );			$('.street-style6 img.moves-left').css('margin-left',-50 - street_style6_distance_1);		}	});	});